import React from 'react';
import allNote from '../notes';

function createContent(x){
  return(
    <div className = 'note'>
      <h1>{x.title}</h1>
      <p>{x.content}</p>
    </div>
  )
}

function Note(){
  return(
    allNote.map(createContent)
  );
};

export default Note;
